import React, { useState, useEffect } from "react";
import { useLocation } from "react-router-dom";
import axios from "axios";
import { loadStripe } from "@stripe/stripe-js";
import { Elements, CardElement, useStripe, useElements } from "@stripe/react-stripe-js";

const stripePromise = loadStripe("pk_test_your_stripe_public_key");

const CheckoutForm = ({ totalAmount }) => {
    const stripe = useStripe();
    const elements = useElements();
    const [loading, setLoading] = useState(false);

    const handleSubmit = async (e) => {
        e.preventDefault();
        setLoading(true);

        if (!stripe || !elements) return;

        const { error, paymentMethod } = await stripe.createPaymentMethod({
            type: "card",
            card: elements.getElement(CardElement),
        });

        if (error) {
            alert(error.message);
            setLoading(false);
        } else {
            try {
                const response = await axios.post("http://localhost:5000/payment", {
                    amount: totalAmount,
                    paymentMethodId: paymentMethod.id,
                });

                if (response.data.success) {
                    alert("Payment Successful! ðŸŽ‰");
                }
            } catch (error) {
                alert("Payment Failed: " + error.message);
            }
            setLoading(false);
        }
    };

    return (
        <form onSubmit={handleSubmit}>
            <CardElement />
            <button type="submit" disabled={!stripe || loading} style={{ background: "#007bff", color: "white", padding: "10px", marginTop: "10px", width: "100%", cursor: "pointer" }}>
                {loading ? "Processing..." : `Pay INR ${totalAmount}`}
            </button>
        </form>
    );
};

const Payment = () => {
    const location = useLocation();
    const params = new URLSearchParams(location.search);
    const eventId = params.get("event");

    const [event, setEvent] = useState(null);
    const [tickets, setTickets] = useState(1);
    const [attendees, setAttendees] = useState([{ name: "", gender: "" }]);

    useEffect(() => {
        if (eventId) {
            axios.get(`http://localhost:5000/events/${eventId}`)
                .then((response) => setEvent(response.data))
                .catch((error) => console.error("Error fetching event:", error));
        }
    }, [eventId]);

    useEffect(() => {
        setAttendees(Array.from({ length: tickets }, () => ({ name: "", gender: "" })));
    }, [tickets]);

    if (!event) return <p>Loading payment details...</p>;

    const totalAmount = event.price * tickets + 50;

    return (
        <div style={{ padding: "20px", maxWidth: "900px", margin: "auto" }}>
            <h2>Payment</h2>

            <div style={{ display: "grid", gridTemplateColumns: "1fr 1fr", gap: "20px" }}>
                <div>
                    <h3>Details</h3>
                    <label>Number of Tickets:</label>
                    <input type="number" value={tickets} min="1" onChange={(e) => setTickets(parseInt(e.target.value))} style={{ width: "50px", margin: "10px 0" }} />
                    <h3>Order Summary</h3>
                    <p><strong>{event.title}</strong></p>
                    <p>â‚¹{event.price} x {tickets} Tickets</p>
                    <p>Platform Fees: â‚¹50</p>
                    <h3>Total: â‚¹{totalAmount}</h3>
                </div>

                <div>
                    <h3>Enter Payment Details</h3>
                    <Elements stripe={stripePromise}>
                        <CheckoutForm totalAmount={totalAmount} />
                    </Elements>
                </div>
            </div>
        </div>
    );
};

export default Payment;
